import React from 'react';
import './Listagem.css';

const Listagem = ({ simulacoes }) => {
  return (
    <div>
      <h2>Listagem de Simulações</h2>
      <table className="listagem-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Nome</th>
            <th>Email</th>
            <th>Telefone</th>
            <th>Código da Unidade</th>
            <th>Modelo Fásico</th>
            <th>Enquadramento</th>
            <th>Histórico de Consumo em kWh</th>
          </tr>
        </thead>
        <tbody>
          {simulacoes.map((simulacao) => {
            const unidades = simulacao.unidades || [];

            // Verifica se unidades é um array
            if (!Array.isArray(unidades)) {
              return null;
            }

            const id = simulacao.id || '';
            const nomeCompleto = simulacao.nomeCompleto || '';
            const email = simulacao.email || '';
            const telefone = simulacao.telefone || '';

            return unidades.map((unidade, index) => {
              // Verifica se unidade é um objeto
              if (typeof unidade !== 'object' || unidade === null) {
                return null;
              }

              return (
                <tr key={`${id}-${index}`}>
                  <td>{id}</td>
                  <td>{nomeCompleto}</td>
                  <td>{email}</td>
                  <td>{telefone}</td>
                  <td>{unidade.codigoDaUnidadeConsumidora || 'N/A'}</td>
                  <td>{unidade.modeloFasico || 'N/A'}</td>
                  <td>{unidade.enquadramento || 'N/A'}</td>
                  <td>{unidade.historicoDeConsumoEmKWH?.[0]?.consumoForaPontaEmKWH || 'N/A'}</td>
                </tr>
              );
            });
          })}
        </tbody>
      </table>
    </div>
  );
};

export default Listagem;
